import React from "react";
import { Row, Col, Form } from "react-bootstrap";

const DateTime = (props) => {
  return (
    <Row>
      <Col sm={5} md={12} lg={12}>
        <Form
          className="py-4 d-flex align-items-center flex-column"
          style={{ fontFamily: "primary-font" }}
        >
          <Form.Group>
            <Form.Control
              size="lg"
              type="date"
              name="meeting_date"
              value={props.value}
              style={{
                marginBottom: "1rem",
                padding: "1rem",
                fontSize: 25,
                borderRadius: 20,
                borderBottom: "3px solid grey",
              }}
            />
          </Form.Group>
          <Form.Group>
            <Form.Control
              size="lg"
              type="time"
              style={{
                marginBottom: "0.5rem",
                padding: "1rem",
                fontSize: 25,
                borderRadius: 20,
                borderBottom: "3px solid grey",
              }}
            />
          </Form.Group>
        </Form>
      </Col>
    </Row>
  );
};

export default DateTime;
